import { Link } from 'react-router-dom';
import './style.css';
import { ProductConsumer } from '../Context/context';

export default class Snack extends Component {
  render() {
    const { id, title, img} = this.props.snack;
    return (
      <div className="card">
          <div className="snack-img">
            <img src={img}/>
          </div>
      </div>
    )
  }
}
